A common use case is transforming an incoming structure into a modified outgoing structure. Take the following input structure: { "first_name": "john", "last_name": "doe", "address": "123 Lane", "city": "Springfield", "state": "OR"
} We only want to export the name and a combined address: import "strings" first_name: string
last_name: string
address: string
city: string
state: string result: { name: strings.ToTitle(strings.Join([first_name, last_name], " ")) full_address: "\(address)\n\(city), \(state)"
} We can then ask CUE to only render our result expression: $ cue export -e result file1.cue file2.json
{ "name": "John Doe", "full_address": "123 Lane\nSpringfield, OR"
} This allows ingesting one data structure and exporting another. As shown in the example, we can perform many permutations on the incoming data using CUE's standard library and interpolation .

