Nixago offers various engines which can be used for transforming input data into an output file. Nixago will default to the nix engine that utilizes pkgs.formats from nixpkgs . let configData = { "field1" = "value1"; "field2" = true; };
in
nixago.lib.make { inherit configData; output = "config.json"; format = "json"; engine = nixago.engines.nix { }; # Optional as this is the default value
} The result of this invocation will be an attribute set with two attributes: configFile: A derivation for building the configuration file. shellHook: A shell hook for managing the file. Building the derivation produces a file with the following output: { "field1": "value1", "field2": true
} The make function takes an attribute set that supports the options defined in the request module . Please refer to the module definition for all of the available options.

