When using CUE, you will typically define one or more CUE files that will be merged into the desired output. For example, if we had the below CUE file: name: string
name: "John Doe" We could then export it and get the following result: $ cue export file.cue
{ "name": "John Doe"
} When CUE is presented with multiple files, they are all merged into one singular output: name: string name: "John Doe" $ cue export file1.cue file2.cue
{ "name": "John Doe"
}

