CUE is a superset of JSON, so it's possible to merge JSON and CUE files. Using our previous example, this time with JSON: name: string { "name": "John Doe"
} cue export file1.cue file2.json
{ "name": "John Doe"
} We get the same result because our JSON file and the previously defined CUE file are functionally equivalent.
